(function(){var b=["log","debug","info","warn","error","time","timeEnd"];c=window.console;if(!c){c={};for(var a=0;a<b.length;a++){c[b[a]]=function(){}}window.console=c}else{if(typeof(c.time)==="undefined"){c.mytimer={};c.time=function(e){if(!e){return}var g=(new Date()).getTime(),f=e.toString();if(!c.mytimer[f]){c.mytimer[f]=g}};c.timeEnd=function(f){if(!f){return}var e=(new Date()).getTime(),g=f.toString(),h=c.mytimer[g];if(h){console.log(f+": "+(e-h)+"ms");delete console.mytimer[g]}}}if(typeof(c.debug)==="undefined"){c.debug=c.log}if(typeof(c.exception)==="undefined"){c.exception=function(f){if(f){if(f.stack){c.error(f.stack)}else{c.error(f)}}}}for(var a=0;a<b.length;a++){if(typeof(c[b[a]])==="undefined"){c[b[a]]=function(){}}}}var d={};for(var a=0;a<b.length;a++){d[b[a]]=c[b[a]]}c.disable=function(e){c[e]=function(){}};c.enable=function(e){c[e]=d[e]};c.disableAll=function(){for(var e=0;e<b.length;e++){c[b[e]]=function(){}}};c.enableAll=function(){for(var e=0;e<b.length;e++){c[b[e]]=d[b[e]]}}})();